g2:c.PROCEDURE.g2:a.TEXT:
gdd-add-olh-keys (Context: item-or-value, Client: class ui-client-item, TagLIst: class symbol-list)

Tag : symbol;
Pos, Len : integer;

begin 
    if Context is an item then begin
        if Context is a method then  begin
             Tag = the name of Context;
             Pos = position-of-text ("::", "[Tag]"); 
             Len = length-of-text ("[Tag]");
             Tag = symbol (get-from-text ("[Tag]", Pos + 2, Len));
             inform the operator that "[Tag]"; 
             insert Tag at the end of TagList 
        end else if Context is a procedure then begin
             Tag = the name of Context;
             insert Tag at the end of TagList 
        end else begin
             Tag = the class of Context;
             insert Tag at the end of TagList 
        end;
    end;
end

_gdd-rotate-point (X : integer, Y : integer, XOrigin : integer, YOrigin : integer, Degrees : float) = (integer, integer)
    Radius : float;
    Theta : float;
begin

    {-- Normalize X and Y relative to the origin --}
    X = X - XOrigin;
    Y = YOrigin - Y;
 
    Radius = sqrt (X ^ 2.00 + Y ^ 2.00);
 
    if X = 0 then Theta = _PI / 2.00 
    else Theta =  arctan (abs (Y / X));
    
    if X <= 0 and Y >= 0 then Theta = _PI - Theta
    else if X <= 0 and Y <= 0 then Theta = Theta + _PI 
    else if X >= 0 and Y <= 0 then Theta =  2.00 * _PI - Theta;

    Theta = Theta - Degrees * _PI / 180.00;
 
    X = round ( Radius * cos ( Theta ));
    Y = round ( Radius * sin ( Theta ));

    X = X + XOrigin;
    Y = YOrigin - Y;

    return X, Y;
end

gdd-get-class-variables (Obj : class item) = (structure)
    Variables : structure = structure (); 
    ClassVariable : structure;
    ClassVariables : sequence;
begin
    ClassVariables = the VARIABLES of the ICON-DESCRIPTION of the class-definition named by the CLASS of Obj;

    for ClassVariable = each structure in ClassVariables do
       Variables = change-evaluated-attribute (Variables, the VARIABLE-NAME of ClassVariable, the INITIAL-VALUE of ClassVariable);
    end;

    Variables = change-evaluated-attribute (Variables, the symbol WIDTH, the WIDTH of the ICON-VARIABLES of OBJ); 
    Variables = change-evaluated-attribute (Variables, the symbol HEIGHT, the HEIGHT of the ICON-VARIABLES of OBJ); 

    return Variables;
end

g2:c.METHOD.g2:a.TEXT:
gdd-deactivate (Def : class class-definition)
    Info : class gdd-class-information-object;
begin
    for Info = each gdd-class-information-object
      that is a-gdd-class-information-object-for-the-class-of Def do
        conclude that the gdd-status of Info = the symbol INACTIVE;
    end;
end

g2:c.PROCEDURE.g2:a.TEXT:
gdd-update (Obj: class object) 
    Attr : symbol;
    Info: class gdd-class-information-object;
    Layer : symbol;
    Layers : sequence;
    DegreesToRotate : float;
    Range: float;
    MaximumValue: value;
    MinimumValue: value;
    AttrValue : value;
    Variables : structure;
    Length : value;
    XShift : integer = 0;
    YShift : integer = 0;
    XOrigin: integer;
    YOrigin: integer;
    Clockwise : integer = 1;
begin
   
    If the VARIABLES of the ICON-DESCRIPTION of the class-definition named by the CLASS of Obj exists then 
    begin        
        Variables = call gdd-get-class-variables (Obj);

        for Info = each gdd-class-information-object that is a-gdd-class-information-object-for-the-class-of the class-definition named by the class of Obj do

          if the GDD-STATUS of Info = the symbol ACTIVE then
          begin

            Attr = the GDD-TARGET-ATTRIBUTE of Info;     
            
            if the value that is an attribute of Obj named by Attr exists then 
            begin  
                AttrValue = the value that is an attribute of Obj named by Attr;
                            
                Layers = the GDD-POINTER-REGION of Info;

                XOrigin = the GDD-HORIZONTAL-CENTER of Info;
                YOrigin = the GDD-VERTICAL-CENTER of Info; 

                if Info is a gdd-radial-class-information-object then
                begin
                    Range = the GDD-RANGE of Info;
                    MaximumValue = the GDD-MAXIMUM-VALUE of Info;
                    MinimumValue = the GDD-MINIMUM-VALUE of Info;
                    if the GDD-CLOCKWISE of Info = false then Clockwise = -1;

                    if AttrValue >= MaximumValue then 
                        DegreesToRotate = Clockwise * Range
                    else if AttrValue <= MinimumValue then 
                        DegreesToRotate = 0
                    else
                        DegreesToRotate = Clockwise * (AttrValue - MinimumValue) / (MaximumValue - MinimumValue) * Range; 
        
                    for Layer = each symbol in Layers do
                        Variables = call gdd-rotate-icon-layer (Layer, Variables, DegreesToRotate, XOrigin, YOrigin);
                    end;

                    if the GDD-SHADOW of Info is true then
                    begin
                        Variables = call gdd-rotate-icon-layer (symbol ("[the NAME of Info]-SHADOW"), Variables, DegreesToRotate, XOrigin, YOrigin); 
                        Variables = call gdd-shift-icon-layer (symbol ("[the NAME of Info]-SHADOW"), Variables, the GDD-SHADOW-OFFSET of Info, the GDD-SHADOW-OFFSET of Info);
                    end;

                    if the GDD-TRACKING-LABEL of Info is true then
                    begin
                        Variables = call gdd-rotate-icon-layer (symbol ("[the NAME of Info]-TRACKING-LABEL"), Variables, DegreesToRotate, XOrigin, YOrigin); 
                        Variables = change-evaluated-attribute (Variables, symbol ("[the NAME of Info]-TRACKING-LABEL-1-TEXT-LABEL"),  "[AttrValue]")
                    end;

                end;

                if Info is a gdd-floating-class-information-object or Info is a gdd-linear-class-information-object then
                begin
                    Length = the GDD-LENGTH of Info;
                    MaximumValue = the GDD-MAXIMUM-VALUE of Info;
                    MinimumValue = the GDD-MINIMUM-VALUE of Info; 

                    if the GDD-ALIGNMENT of Info = the symbol HORIZONTAL then
                    begin
                        if AttrValue >= MaximumValue then 
                            XShift = Length
                        else if AttrValue <= MinimumValue then 
                            XShift = 0
                        else
                            XShift = round ((AttrValue - MinimumValue) / (MaximumValue - MinimumValue) * Length);

                        {-- Normalize the pointer relative to the Length --}
                        XShift = XShift - Length;
                    end
                    else
                    begin
                        if AttrValue >= MaximumValue then 
                            YShift = -1 * Length
                        else if AttrValue <= MinimumValue then 
                            YShift = 0
                        else
                            YShift = -1 * round ((AttrValue - MinimumValue) / (MaximumValue - MinimumValue) * Length);
                        {-- Normalize the pointer relative to the Length --}
                        YShift = YShift + Length; 
                    end;
        
                    for Layer = each symbol in Layers do
                        Variables = call gdd-shift-icon-layer (Layer, Variables, XShift, YShift);
                    end;

                    if the GDD-SHADOW of Info is true then
                    begin 
                        Variables = call gdd-shift-icon-layer (symbol ("[the NAME of Info]-SHADOW"), Variables, XShift + the GDD-SHADOW-OFFSET of Info, YShift + the GDD-SHADOW-OFFSET of Info);
                    end;

                    if the GDD-TRACKING-LABEL of Info is true then
                    begin
                        Variables = call gdd-shift-icon-layer (symbol ("[the NAME of Info]-TRACKING-LABEL"), Variables, XShift, YShift); 
                        Variables = change-evaluated-attribute (Variables, symbol ("[the NAME of Info]-TRACKING-LABEL-1-TEXT-LABEL"),  "[AttrValue]")
                    end; 
 
                end; 

            end; {-- end if the GDD-TARGET = Attr --}

          end;  {-- end if active --}

        end; {-- end for each gdd-class---}

        conclude that the ICON-VARIABLES of Obj = Variables;

    end {-- end if Attr exists --}
end

gdd-shift-icon-layer (LayerName : symbol, Variables : structure, XShift: integer, YShift: integer) = (structure)
    NameLength : integer = length-of-text ("[LayerName]"); 
    Variable : symbol;
    XVariable, YVariable : symbol;
    Pos, Len : integer;
    Prefix: text;
    X, Y : integer; 
begin 
    for Variable = each symbol that is an attribute name of Variables do
        if length-of-text ("[Variable]") >= NameLength and is-contained-in-text ("-X", "[Variable]") and get-from-text ("[Variable]", 1, NameLength) = "[LayerName]" then
        begin          
            Pos = position-of-text ("-X", "[Variable]");
            Len = length-of-text ("[Variable]");
            Prefix = "[get-from-text ("[Variable]", 1, Pos)]Y";

            XVariable = Variable; 
            YVariable = symbol ("[Prefix][get-from-text ("[Variable]", Pos+2, Len)]");

             X = the value that is an attribute of Variables named by XVariable;
             X = X + XShift; 
             Variables = change-evaluated-attribute (Variables, XVariable, X);
 
             if the value that is an attribute of Variables named by YVariable exists then
             begin            
                Y = the value that is an attribute of Variables named by YVariable;                
                Y = Y + YShift;
                Variables = change-evaluated-attribute (Variables, YVariable, Y);
            end; 

        end; 
    end;

    return Variables;
end

gdd-rotate-icon-layer (LayerName : symbol, Variables : structure, Degrees : float, XOrigin : item-or-value,  YOrigin : item-or-value) = (structure)
    NameLength : integer = length-of-text ("[LayerName]");
    Variable : symbol;
    XVariable, YVariable : symbol;
    Pos, Len : integer;
    Prefix: text;
    X, Y : integer; 
begin
    if XOrigin is not an integer then 
        XOrigin = round (the WIDTH of Variables / 2);

    if YOrigin is not an integer then 
        YOrigin = round (the HEIGHT of Variables / 2);
 
    for Variable = each symbol that is an attribute name of Variables do
        if length-of-text ("[Variable]") >= NameLength and is-contained-in-text ("-X", "[Variable]") and get-from-text ("[Variable]", 1, NameLength) = "[LayerName]" then
        begin          
            Pos = position-of-text ("-X", "[Variable]");
            Len = length-of-text ("[Variable]");
            Prefix = "[get-from-text ("[Variable]", 1, Pos)]Y";

            XVariable = Variable; 
            YVariable = symbol ("[Prefix][get-from-text ("[Variable]", Pos+2, Len)]");

            X = the value that is an attribute of Variables named by XVariable;
            Y = the value that is an attribute of Variables named by YVariable; 
 
            X, Y = call _gdd-rotate-point (X, Y, XOrigin, YOrigin, Degrees);

            Variables = change-evaluated-attribute (Variables, XVariable, X);
            Variables = change-evaluated-attribute (Variables, YVariable, Y); 
        end; 
    end;

    return Variables;
end

gdd-shift-icon (Obj : class item, XShift: integer, YShift: integer)
    Variables : structure;
    Variable : symbol;
    XVariable, YVariable : symbol;
    Pos, Len : integer;
    Prefix: text;
    X, Y : integer; 
begin
    Variables = the ICON-VARIABLES of Obj;
 
    for Variable = each symbol that is an attribute name of Variables do
        if is-contained-in-text ("-X", "[Variable]") then
        begin          
            Pos = position-of-text ("-X", "[Variable]");
            Len = length-of-text ("[Variable]");
            Prefix = "[get-from-text ("[Variable]", 1, Pos)]Y";

            XVariable = Variable; 
            YVariable = symbol ("[Prefix][get-from-text ("[Variable]", Pos+2, Len)]");

             X = the value that is an attribute of Variables named by XVariable;
             X = X + XShift; 
             Variables = change-evaluated-attribute (Variables, XVariable, X);
 
             if the value that is an attribute of Variables named by YVariable exists then
             begin            
                Y = the value that is an attribute of Variables named by YVariable;                
                Y = Y + YShift;
                Variables = change-evaluated-attribute (Variables, YVariable, Y);
            end; 

        end; 
    end;

    conclude that the ICON-VARIABLES of Obj = Variables;
end

